import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
    display: flex;
    height: 90%;
`

const Left = styled.div`
    height: 10%;
    width: 60%;
    background-color: red;
`
const Right = styled.div`
    height: 10%;
    width: 40%;
    background-color: blue;
`

const Hero = () => {
  return (
    <Container>
      <Left>Left</Left>
      <Right>Right</Right>
    </Container>
  )
}

export default Hero
